  false,\n\t\"url\": null,\n\t\"notes\": \"The purpose of this report is to: (1) identify
  specific contaminant issues of concern for each Montana refuge and wetland management
  district; (2) summarize the contaminant biomonitoring residue data collected to
  date at each refuge or wetland management district and evaluate their potential
  biological significance; and (3) where appropriate, recommend performing reconnaissance
  environmental contaminant surveys, status and trend contaminant biomonitoring, further
  in-depth contaminant investigations and/or propose remedial actions to improve the
  chemical integrity of Service lands in Montana. This report is designed to provide
  a quick reference pertaining to environmental contaminant investigations that are
  being proposed or previously performed at national wildlife refuges in Montana.
  More detailed information concerning specific studies conducted at Montana refuges
  may be obtained from the Service's Environmental Contaminant Specialist stationed
  at the Fish and Wildlife Enhancement Office in Helena, Montana.\",\n\t\"license_title\":
